export const hazureSound = process.browser
  ? new Audio(
      "data:audio/wav;base64,",
    )
  : null
export const hazureSoundOrg = process.browser
  ? new Audio(
      "data:audio/wav;base64,",
    )
  : null
export const atariSound = process.browser
  ? new Audio(
      "data:audio/wav;base64,",
    )
  : null

export const playCorrectOrInCorrectSound = (correct: boolean) => {
  resetAudio(hazureSound)
  resetAudio(atariSound)

  const a = correct ? atariSound : hazureSound

  if (a) {
    a.play().then()
  }
}

const resetAudio = (a: HTMLAudioElement | null) => {
  if (!a) return
  a.pause()
  a.currentTime = 0
}
